import React, { useState } from 'react';
import './Header.css'; // If you want to use a separate CSS file for header styles

function Header() {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <header>
      <nav className="navbar">
        <div className="navbar-logo">Priya Portfolio</div>
        <button
          className={`mobile-menu ${isOpen ? 'active' : ''}`}
          onClick={() => setIsOpen(!isOpen)}
          aria-label="Toggle navigation"
        >
          <span></span><span></span><span></span>
        </button>
        <ul className={`navbar-links ${isOpen ? 'nav-open' : ''}`}>
          <li><a className="navbar-link" href="#home">Home</a></li>
          <li><a className="navbar-link" href="#skills">Skills</a></li>
          <li><a className="navbar-link" href="#projects">Projects</a></li>
          <li><a className="navbar-link" href="#education">Education</a></li>
          <li><a className="navbar-link" href="#experience">Experience</a></li>
          <li><a className="navbar-link" href="#contact">Contact</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
